import { Footer } from './Layout/Footer/Footer';
import { Header } from './Layout/Header/Header';


class App extends Component {
  render() {
    return (
      <React.Fragment>
      <Header/>
      <Footer/>
      </React.Fragment>
    )
  }
}

export default App
